import { Table } from "react-bootstrap";
import { useDispatch } from "react-redux";

function TableCompo({ localData }) {
    const style = {
        width: 800 + "px",
        margin: "23px",
    }
    const dispach = useDispatch()

    const removeItem = (data) => {
        const removedData = localData.tabaleData.filter((item) => {
            return item.name !== data.name
        })
        console.log(removedData);
    }
    return <Table style={style} striped bordered hover variant="dark">
        <thead>
            <tr>
                <th>Name</th>
                <th>Profile</th>
                <th>Phone</th>
                <th>Action</th>
            </tr>
        </thead>
        <tbody>
            {localData.tabaleData.length ? localData.tabaleData.map((item, i) => {
                if (item.name.length) {
                    return <tr key={i}>
                        <td>{item.name}</td>
                        <td>{item.profile}</td>
                        <td>{item.number}</td>
                        <td>
                            <button onClick={() => {
                                removeItem(item)
                            }}>Delete</button>
                        </td>
                    </tr>
                } else {
                    return
                }
            }) : <></>}


        </tbody>
    </Table>
}
export default TableCompo
